var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'week', 'text': '', 'tags': '', 'url': 'week.html'}, {'title': 'week1', 'text': '建立個人倉儲cd2020及進行網站編譯 \n 建立個人倉儲以及完成CMSIMDE網站 \n 個人倉儲: \n \n CMSIMDE 網站架設: \n \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': 'Fork分組倉儲並更新python3.8.2 \n Fork分組倉儲: \n \n \n 更新python到python3.8.2 \n 1.進入\xa0 https://www.python.org/downloads/release/python-382/ \n 2.滑至最底，找到 Windows x86-64 executable installer 並下載。 \n 3.下載完成後開啟 \n 4.不要勾選pip選項，接著按下next \n \n 5.選擇路徑將python安裝至可攜式系統中的Y槽下 \n 6.接著開啟start_mdecourse.bat批次檔 \n 7.將安裝的版本資料夾取名為py382 \n \n 8.將 start_mdecourse.bat批次檔中的py373改為安裝python 3.8.2版本的資料夾 \n \n 8.執行stop.bat批次檔後重新啟動start_mdecourse(為了讓檔案重新讀取) \n 9.輸入get-pip.py，開始安裝pip工具 \n \n 10.安裝cmsimde所需模組 \n 輸入pip install flask bs4 lxml pelican markdowm flask_cors \n \n 完成後確認版本是否成功更新即完成更新python3.8.2 \n \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week6', 'text': '課程內容: \n 安裝OBSPortable.exe與yotube做配合,往後拍影片,頭像左下角需要有自己的影像 \n 安裝並開啟pyslvs.exe,設定四連趕模擬,觀察連趕運動方向 \n', 'tags': '', 'url': 'week6.html'}, {'title': '直播會議討論', 'text': '', 'tags': '', 'url': '直播會議討論.html'}, {'title': 'w2', 'text': '1.分配小組工作內容 \n 2.問題討論 \n \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '會議內容: \n 講解python亂數分組程式,以及跟各個細分組長說明接下來必須同時對小組網站進行協同,小組長必須以pull request的方式將改版網站給組長,組長在選擇merge,解決可能合併會產生的問題 \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w5', 'text': '會議內容: \n 了解webots totural , 並翻譯 \n 註冊onshape \n onshape \n 下載webots \n', 'tags': '', 'url': 'w5.html'}]};